import React from "react";

const Input = ({ type, id, name, title, htmlfor }) => {
  return (
    <div className="input-wrapper">
      <label htmlFor={htmlfor}>{title}</label>
      <input type={type} id={id} name={name} />
    </div>
  );
};

export default Input;
